import React from 'react';
import { Container } from 'react-bootstrap';
//import {Link} from 'react-router-dom';
//import './styles.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';



function Rodape() {
  
  return (
    <Container fluid>
    <Navbar    bg="warning" variant="light" className="justify-content-center" expand="lg"> 
    <Nav  defaultActiveKey="/home" as="ul">
      <Nav.Item  as="li">
        <Nav.Link href="/redessociais"> Redes Sociais </Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href="/contatos">Reservas</Nav.Link>
      </Nav.Item>
      <Nav.Item as="li">
        <Nav.Link href="/Intranet">WhatsApp</Nav.Link>
      </Nav.Item>
    </Nav>
    </Navbar>
    </Container>
         
  );
}

export default Rodape;
